async function project(seed, embeddingsArray) {
  console.log(`projecting with seed: ${seed}...`);
  const prng = new Prando(seed);
  const random = () => prng.next();
  const projections = await (new UMAP({random}).fitAsync(embeddingsArray));
  const iteration = {
    seed,
    projections
  };
  console.log('iteration:', iteration);
  return iteration;
}

async function embed(model, sentences) {
  const embeddings = await model.embed(sentences);
  const embeddingsArray = await embeddings.array();
  
  return embeddingsArray;
}

